import http from "../common-api";

const GetPollPercentages = (questionid, data) => {
    return http.httpdefault().post("/polls/" + questionid + "/getPercentages", data);
  };
  
const PutPollsVotes = (id, data) => {
  return http.httpdefault().put("/polls/" + id + "/UpdateVotes", data);
};


export default {
  GetPollPercentages,
  PutPollsVotes,
};
